LITHOLOGY 

Rig crews caught lagged samples in 30’ intervals under the supervision of Sunburst geologists. A detailed list of 
sampling intervals is included in the well data summary page. Sample or gamma ray marker tops have been inserted 
in the sample descriptions below for reference. Samples were examined wet and dry under a trinocular microscope. 
The drilling fluid was diesel-based invert from surface casing to intermediate casing, while salt water drilling fluid 
was used throughout the lateral.  Sample collection began at 8,200’ MD.  

